import React, { Component } from "react";
import { GoogleMap, withSciprtjs, withGoogleMap } from '@react-google-maps/api';

const containerStyle = {
    width: '400px',
    height: '400px'
};

const center = {
    lat: 40.7128,
    lng: 74.0060
  };

function Map() {
      return (
        <GoogleMap
          center={center}
          zoom={10}
        />
      )
}

export default Map;
